                <h3>

            <script type="text/ng-template" id="bookdivs.html">
                <div class="col-md-6"><div ng-repeat="b in firsts track by $index"><bookdivitem b="b" usertype="usertype" isguest="isguest" ishigh="ishigh" isself="isself"></bookdivitem></div></div><div class="col-md-6"><div ng-repeat="b in seconds track by $index"><bookdivitem b="b" usertype="usertype" isguest="isguest" ishigh="ishigh" isself="isself"></bookdivitem></div></div>
            </script>
            <script type="text/ng-template" id="bookdivitem.html">
                <div class="jiqiren" style="padding-left:8px;padding-right:5px;"><h4>[[b.pos]].<a ng-href="/book/[[b.id]]/"><span ng-if="b.name">[[b.name]]</span><span ng-if="!b.name">---</span></a> &nbsp;<i class="fa fa-lock" ng-if="b.islock"> </i><span ng-if="b.booktype == 1" style="padding-left:10px;">棋谱</span><br/><small ng-if="b.booktype == 0">共[[b.ba.qcount]]道题目，难度：[[b.ba.qlevelname]]</small><small ng-if="b.userid != 1" style="padding-left:5px;"><a  ng-href="/u/[[b.username]]/" target="_blank">[[b.username]]</a> 分享</small><small class="pull-right" style="padding-right:5px;" ng-if="isself"><span ng-if="!b.isshowmove"><a ng-click="showmove(b)">移动</a></span><span ng-if="b.isshowmove">移到：<input type="text" size="3" ng-model="mm.number">&nbsp;<a ng-click="moveto(b,$index)">确定</a>&nbsp;&nbsp;<a ng-click="showmove(b)">取消</a></span></small></h4><hr style="margin-top:10px;margin-bottom:10px;"/><div ng-if="isshowlogin"><p>欢迎关注101围棋公众号，无需注册，直接通过微信就可以做棋书<span style="padding-left:10px;padding-right:10px;" class="pull-right"><a ng-click="showlogin()"><i class="fa fa-close" ></i></a></span></p><p><img src="https://static2.101weiqi.com/static/images/weiqinew.jpg" class="img-responsive img-thumbnail" width="172"></p><p>或者先 <a href="/register/">注册</a> / <a href="/login/">登录</a>之后，才能开始做棋书</p></div><div ng-if="!isshowlogin"><p ng-if="b.booktype == 0"><span ng-if="isguest"><a class="btn btn-success" ng-click="showlogin()">开始做题</a>&nbsp;<a ng-click="showlogin()">做题形式设置</a> &nbsp;&nbsp;<a ng-click="showlogin()">我的棋书错题本</a></span><span ng-if="!isguest"><a class="btn btn-success" ng-href="/book/doing2/[[b.id]]/">开始做题</a>&nbsp;<a ng-href="/book/dosetting2/[[b.id]]/">做题形式设置</a> &nbsp;&nbsp;<a ng-href="/book/myerror2/[[b.id]]/">我的棋书错题本</a></span></p><div ng-if="b.ebook.id > 0"><p class="text-success" style="line-height:150%;"><span ng-if="b.ebook.qcount > 0">我的做题数据：在[[b.ebook.qcount]]道题目中完成[[b.ebook.total]]次，正确率为[[b.ebook.okpercent]]%，平均做题时间[[b.ebook.pretime]]秒<span ng-if="usertype == 0">，统计截止于[[b.ebook.updated]]，成为<a href="/changepower/">银卡以上会员</a>将会持续统计</span></span><span ng-if="b.ebook.qcount == 0">棋友完成棋书作业后，将在此显示本书做题数据统计（每天晚上统计，针对<a href="/changepower/">银卡以上会员</a>）</span></p></div><div ng-if="b.ebook.id == 0 && b.booktype == 0">棋友完成棋书作业后，将在此显示本书做题数据统计（每天晚上统计，针对<a href="/changepower/">银卡以上会员</a>）</div><p ng-if="b.booktype == 0" class="text-success" style="margin-top:5px;"><a ng-href="/book/levelorder/[[b.id]]/">&rarr;按难度顺序查阅本书</a></p><p>[[b.desctext]]</p><p><a ng-click="starbook()"><span ng-if="!b.isstar"><img class="starimg" src="https://static2.101weiqi.com/static/images/star_inactive.gif" >&nbsp;&nbsp;<span class="startip">收藏本棋书</span></span><span ng-if="b.isstar"><img class="starimg" src="https://static2.101weiqi.com/static/images/star_active.gif" >&nbsp;&nbsp;<span class="startip">取消收藏</span></span></a><span style="padding-left:10px;color:blue;">[[b.startip]]</span><span ng-repeat="t in b.tags" style="padding-left:5px;"><a ng-href="/book/tag/[[t.id]]/">[[t.name]]</a></span><span ng-if="ishigh" style="padding-left:5px;"><a ng-click="showedittag()" ng-if="!isshowtag">编辑标签</a><a ng-click="showedittag()" ng-if="isshowtag">关闭</a></span></p><div class="col-md-12 tageditdiv" ng-if="isshowtag"><input type="text" class="col-md-12" ng-model="b.tagname" placeholder="标签名称"><div class="col-md-12" style="margin-top:5px;" ng-if="!issaveing"><a class="btn btn-success" ng-click="savetag()">保存标签</a></div><span ng-if="issaveing"><i class="fa fa-spinner fa-spin fa-x fa-fw"></i></span></div><div class="clear"></div></div></div>
            </script>
            <script type="text/ng-template" id="booklists.html">
                <div class="warptext"><table class="table table-condensed table-hover " style="margin-bottom:2px;"><tbody><tr ng-repeat="b in books"><td>[[$index +1]].</td><td class="booklistname" ><span ng-if="b.pinyin"><a ng-href="/book/[[b.pinyin]]/">[[b.name]]</a></span><span ng-if="!b.pinyin"><a ng-href="/book/[[b.id]]/">[[b.name]]</a></span></td><td ><span ng-if="b.booktype == 0">[[b.ba.qcount]]题，[[b.ba.qlevelname]]</span></td><td><span ng-if="b.userid != 1" style="padding-left:5px;"><a  ng-href="/u/[[b.username]]/" target="_blank">[[b.username]]</a>分享</span></td><td ng-if="ishigh"><a ng-click="showedittag(b)" >标签</a><span style="padding-left:3px;"><a ng-click="showeditscore(b)" >打分([[b.score]])</a></span></td><td>[[b.desctext]]</td></tr></tbody></table></div>
            </script>

            </script>

            </script>
